sys_variable_value.value:
(function execute(inputs, outputs) {
var weekday = inputs.weekday

function getWeekday() {
    switch (weekday) {
        case "Monday": 
            return 0;
        case "Tuesday": 
            return 1;
        case "Wednesday":
            return 2;
        case "Thursday": 
            return 3;
        case "Friday": 
            return 4;
        default:
            return null;
    }
}

var weekday = getWeekday();
  var test
 function GetNextMonday(weekday) {
    var date = new GlideDate();
    var today = new GlideDate().getDayOfMonthNoTZ(); //Day number of the month
    var dayInWeek = date.getDayOfWeekLocalTime();

    var nextWeekday = (7 - dayInWeek + weekday); 

    date.addDaysLocalTime(nextWeekday); // interger of days until next weekday
   date.getDisplayValue



    return date;

}
   var result=  GetNextMonday(weekday);

outputs.day =  test
  outputs.date = result

})(inputs, outputs);

